__NUXT_JSONP__("/svet/stat/bouvetuv-ostrov", (function(a){return {data:[{place:[{id:34,mpz:"BV",tld:".bv",name:"Bouvetův ostrov",area:49,population:a,slug:"bouvetuv-ostrov",id_continent:7,number_cities:a,information_chatgpt:"Bouvetův ostrov je malý a vzdálený ostrov v jižním Atlantiku. Je to neobydlené území Norska, které má rozlohu pouhých 49 km². Ostrov je zhruba kruhového tvaru a pokrytý ledovci. Je považován za jedno z nejizolovanějších míst na Zemi, přičemž nejbližší osídlené místo (Jihoafrická republika) je vzdáleno přes 1700 km.\n\nBouvetův ostrov byl objeven v roce 1739 francouzským navigátorem Jeanem-Baptistem Charles Bouvetem de Lozierem a je od té doby předmětem zájmu vědců a badatelů. Na ostrově nebyla nalezena žádná trvalá fauna nebo flóra. Předpokládá se však, že v okolí ostrova mohou být bohaté zásoby ryb a dalších mořských živočichů.\n\nVzhledem k tomu, že je Bouvetův ostrov neobydlený a vzdálený, nemá žádnou ekonomiku ani správu, kromě toho, že je spravován Norskou polární institucí. Ostrov je navštěvován pouze ojediněle vědci a expedicemi, kteří se zajímají o jeho unikátní geologické útvary.",image_cover:a,image_hero:a,currency_code:a,currency_name:"Norská koruna"}],placesCities:[]}],fetch:{},mutations:void 0}}(null)));